import React from 'react';

class MainContent extends React.Component {
    render() {
        return(
        <div className="content">
          <p>This is a paragraph about me...</p>
          <ul>
            <li>Thailand</li>
            <li>Japan</li>
            <li>Nordic Countries</li>
          </ul>
        </div> 
        )
    }
}

export default MainContent
